(1, 1407, '2018-12-15 14:15:47', '<div>PMH:&nbsp; (per pt records) 1. Alzheimer’s Dementia – dx 2005, followed by Dr. Mitchell Heflin, DUMC Division of Geriatrics 2. PMR – tentative dx in 9/2006, started on 60mg Prednisone with a slow taper, currently down to 10mg of Prednisone q day 3. Pseudogout 4. Chronic right wrist and shoulder arthritis – negative work-up 5. Hearing loss&nbsp;</div><div>&nbsp;</div><div>No prior surgeries&nbsp;</div><div>&nbsp;</div><div>Meds: Oxycodone 2.5 Q6H PRN&nbsp; &nbsp;Lorazepam 0.5 TID PRN&nbsp; Miralax packet 17 G QD&nbsp; &nbsp;Lactulose powder 20 G QD&nbsp; Trazodone 50mg QHS&nbsp; &nbsp;Temazepam 30mg QHS&nbsp; Chlorpromazine 50mg QHS&nbsp; &nbsp;Prednisone 10mg QD&nbsp; ASA 81 QD&nbsp; &nbsp; &nbsp;Ferrous gluconate 325 QD&nbsp; Zyprexa 5 mg TID prn&nbsp;</div><div>&nbsp;</div><div>Allergies: (per UNC records)&nbsp;</div><div>Azithromycin, Erythromycin, Lisinopril (reactions unknown)&nbsp;</div><div>&nbsp;</div><div>FH: No history of mental illness or hospitalizations, per pt records&nbsp;</div><div>&nbsp;</div><div>SH: (per CNA sitters from Carolina Meadows and pt records) Lived independently with his wife in Carolina Meadows community until August when his Alzheimer’s progressed to the point that he needed more care than he wife could give.&nbsp; He moved into the Greens-Memory Care unit but was then transferred to the health care center within Carolina Meadows.&nbsp; He was a chemical engineer at ------------------ before moving to NC.&nbsp; No EtOH/tobacco/drugs, per his wife.&nbsp;</div><div>&nbsp;</div><div>PE:&nbsp; T 38.2, HR 115, RR 17, BP 117/62 Gen: pt unresponsive, lying in bed, having some difficulty breathing HEENT: eyes are closed unless deliberately opened by the examiner, PERRL, no scleral icterus.&nbsp; Dry mucus membranes, unable to assess oropharynx 2/2 pt’s inability to hold his mouth open. CV:&nbsp; tachycardia, RRR, II/VI early systolic murmur heard best at apex, no rubs or gallops appreciated. Pul: upper airway sounds heard diffusely across all lung fields, persistent rattling but nonproductive cough exhibited throughout exam Abdm:&nbsp; bowel sounds present, abdomen soft, non-distended.&nbsp; Unable to assess tenderness given pt’s altered MS. GU: pt in diapers, producing clear yellow urine. Extr:&nbsp; no edema, tremor present in both UE and LE. MSK:&nbsp; cogwheeling rigidity in bilateral UE, less rigid 30 min after Dantrolene was hung Neuro:&nbsp; pt is unresponsive, does not withdraw from pain (sternal rub or nail pressure) Skin: flushed, hot to the touch, diaphoretic&nbsp;</div><div>&nbsp;</div><div>Assessment: 82 yo male with Alzheimer\'s dementia, possible seizure disorder and potential PMR admitted from psychiatry for new onset of cough, fever with rigors, and HTN.&nbsp;</div>', NULL, '2018-12-15 14:15:47', '2018-12-15 14:15:47', NULL),
